import React, { Component } from "react";
import './Homepage.css';
// import './Homepage.jpeg' Image_1;

export default class Homepage extends Component {
    render() {
        return (
            <frontpage>

                <h3>The Tomorrow of Management!</h3>

                <p>The new way of Employee Management</p>

                <p3>Allows Employees more control over their work! </p3>
                <image>"./Homepage.jpeg"</image>
                <image>import { './Homepage.jpeg' } from "./Homepage.jpeg" </image>

                </frontpage>
        );
    }
}
